import React, { Component } from 'react'
import PostItem from './postItem';
class Post extends Component {

  render() {
    let postItem;
    if(this.props.Posts){
      postItem = this.props.posts.map(post => {
        return(
          <PostItem key={post.id} post={ post } />
        )
      });
    }
    return (
      <div>
        {postItem}
      </div>
    )
  }
}
export default Post;
